import { Grid } from "../CoreUI/Grid/Grid";
import { GridElement } from "../CoreUI/Grid/GridElement";
import { GridElementHeaderProps } from "../../utils/styleUtils/commonTextProps";

export const ThemeForm = () => {
  return (
    <Grid numCols={12} numRows={3} rowUnit="135px" colUnit="56px" key={1}>
      <GridElement
        position={{
          startCol: 1,
          endCol: 5,
          startRow: 1,
          endRow: 2,
        }}
      >
        <SimpleText {...GridElementHeaderProps(theme)}>Background</SimpleText>
      </GridElement>
      <GridElement
        position={{
          startCol: 5,
          endCol: 9,
          startRow: 1,
          endRow: 2,
        }}
      ><SimpleText {...GridElementHeaderProps(theme)}>Border</SimpleText></GridElement>
      <GridElement
        position={{
          startCol: 9,
          endCol: 13,
          startRow: 1,
          endRow: 2,
        }}
      ><SimpleText {...GridElementHeaderProps(theme)}>Surface</SimpleText></GridElement>
      <GridElement
        position={{
          startCol: 1,
          endCol: 5,
          startRow: 2,
          endRow: 4,
        }}
      ><SimpleText {...GridElementHeaderProps(theme)}>Text</SimpleText></GridElement>
      <GridElement
        position={{
          startCol: 5,
          endCol: 9,
          startRow: 2,
          endRow: 4,
        }}
      ><SimpleText {...GridElementHeaderProps(theme)}>Icon</SimpleText></GridElement>
      <GridElement
        position={{
          startCol: 9,
          endCol: 13,
          startRow: 2,
          endRow: 3,
        }}
      ><SimpleText {...GridElementHeaderProps(theme)}>Tab</SimpleText></GridElement>
    </Grid>
  );
};
